import React from 'react';
import { NavLink } from 'react-router-dom';
import 'styles/Navigation.css'; // импорт файла стилей CSS

const Navigation = () => {
  return (
    <nav className="main-nav">
      <ul className="nav-list">
        <li className="nav-item">
          <NavLink exact to="/" className="nav-link">Home</NavLink>
        </li>
        <li className="nav-item">
          <NavLink to="/introduction" className="nav-link">Introduction</NavLink>
        </li>
        <li className="nav-item dropdown">
          <span className="nav-link dropdown-toggle">Python Basics</span>
          <ul className="dropdown-menu">
            <li className="dropdown-item">
              <NavLink to="/python-basics/variables-data-types" className="nav-link">Variables and Data Types</NavLink>
            </li>
            <li className="dropdown-item">
              <NavLink to="/python-basics/operators-expressions" className="nav-link">Operators and Expressions</NavLink>
            </li>
          </ul>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
